/*
The following script define a method
that increments an integer by 1 
and registers it as a UDF with 
the SparkSession, which can be accessed
using the variable named "spark":
def inc(i: Integer): Integer = {
  i + 1
}
spark.udf.register ("inc", inc _)

*/

select 'UPDATE' AS Type, (select count(*) from
(SELECT DECODE(column_name,'TYPE','REC_TYPE',column_name) from INFORMATION_SCHEMA.COLUMNS where TABLE_SCHEMA = '${SF_SCHEMA_RS}' and table_name ='${record:value('/TABLE')}' minus SELECT column_name from INFORMATION_SCHEMA.COLUMNS where TABLE_SCHEMA = '${SF_SCHEMA_MDB}' and table_name like 'MARSDB_${record:value('/TABLE')}')) AS COL_COUNT, (select count(*) from (
select ${record:value('/MDB_COLUMNS_LIST')} from ${SF_DB}.${SF_SCHEMA_RS}.${record:value('/TABLE')}
where (database || ${record:value('/PK_COLUMN')}) in (select (database || ${record:value('/PK_COLUMN')}) from ${SF_DB}.${SF_SCHEMA_MDB}.MARSDB_${record:value('/TABLE')}) minus SELECT ${str:replace(record:value('/MDB_COLUMNS_LIST'),'TYPE::TEXT AS REC_TYPE','REC_TYPE::TEXT AS REC_TYPE')} from ${SF_DB}.${SF_SCHEMA_MDB}.MARSDB_${record:value('/TABLE')}) U) AS REC_COUNT, COL_COUNT + REC_COUNT AS TOTAL_COUNT;

